(7, 'invitation FIE 2011', NULL, 'Votre invitation gratuite au salon FI (Food Ingredients) Europe & NI (Natural Ingredients) 2011 de  PARIS', 3, '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n	<title>#SUBJECT#</title>\r\n	<meta name="title" content="#SUBJECT#" />\r\n  <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n  <meta http-equiv="Content-Language" content="fr" />\r\n</head>\r\n	<body link="#222221;" marginheight="0" marginwidth="0" leftmargin="0" topmargin="0" bgcolor="#FFFFFF">\r\n<table bgcolor="#f8f7ee" align="center" cellspacing="0" cellpadding="0" border="0" style="width: 700px;">\r\n<tbody>\r\n<tr>\r\n<td align="center"><font face="Arial" style="font-size: 8px;" size="2" color="#000000">&nbsp;Si ce message ne s''affiche pas correctement, vous pouvez le visualiser gr&acirc;ce &agrave; ce <a style="color: #3c779b;" href="#VIEW_ONLINE#"><font color="#3c779b">lien</font></a> </font></td>\r\n</tr>\r\n<tr>\r\n<td style="height: 200px;">\r\n<p>Madame, Monsieur,</p>\r\n<p></p>\r\n<p>Nous vous informons par la pr&eacute;sente que NUTRITIS sera pr&eacute;sent au salon FI Europe &amp; NI 2011 qui se tiendra au Parc des Expositions de PARIS Nord Villepinte du Mardi 29 Novembre au Jeudi 1<sup>er</sup> D&eacute;cembre.</p>\r\n<p>A cette occasion, notre &eacute;quipe commerciale a le plaisir de vous adresser une invitation gratuite pour pouvoir participer &agrave; cet &eacute;v&egrave;nement majeur et&nbsp; incontournable des Ingr&eacute;dients Alimentaires qui a lieu tous les 2 ans en alternance entre les 3 villes de Paris, Londres et Francfort.</p>\r\n<p>Pour faire valoir votre invitation gratuite vous devez vous rendre sur le site suivant <a href="http://www.fieregister.com/">www.fieregister.com</a> et proc&eacute;der &agrave; votre inscription en ligne.</p>\r\n<p>Notre num&eacute;ro de stand est le <b>1D75</b> (au fond du Hall 1) et nous serons ravis de vous y accueillir pour vous faire d&eacute;guster des &eacute;chantillons de produits finis &eacute;labor&eacute;s avec nos solutions sucrantes naturelles 100% extraites de fruits. Par ailleurs nous vous informons que nous mettrons en avant dans la zone &laquo;&nbsp;Produits Nouveaux et Innovants&nbsp;&raquo; notre produit r&eacute;f&eacute;renc&eacute; &laquo;&nbsp;FructiLight&reg;&nbsp;&raquo; qui pr&eacute;sente en plus d&rsquo;une saveur sucr&eacute;e jusqu&rsquo;&agrave; 70%&nbsp; sup&eacute;rieure &agrave; celle du sucre, un Index Glyc&eacute;mique (IG) de 11 soit l&rsquo;IG le plus bas de tous les sucres caloriques du march&eacute;.</p>\r\n<p>Dans l&rsquo;attente de votre visite sur notre stand, veuillez recevoir nos tr&egrave;s sinc&egrave;res salutations,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;L''&eacute;quipe Nutritis</p>\r\n<p>&nbsp;<img src="http://nutritis.catalyz-emailing.com/uploads/assets/invitation_FIE1.jpg" width="700" height="700" style="border-style: initial; border-color: initial; font-family: Arial; font-size: 8px; text-align: -webkit-center;" /><img src="http://nutritis.catalyz-emailing.com/uploads/assets/invitation_FIE2.jpg" width="700" height="700" /></p>\r\n<p></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align="center"><font face="Arial" style="font-size: 8px;" size="2" color="#000000"> Cliquez ici pour vous <a style="color: #000000;" href="#UNSUBSCRIBE#"> d&eacute;sabonner . </a></font></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</body>\r\n</html>', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n	<title>#SUBJECT#</title>\r\n	<meta name="title" content="#SUBJECT#" />\r\n  <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n  <meta http-equiv="Content-Language" content="fr" />\r\n</head>\r\n	<body link="#222221;" marginheight="0" marginwidth="0" leftmargin="0" topmargin="0" bgcolor="#FFFFFF">\r\n<table bgcolor="#f8f7ee" align="center" cellspacing="0" cellpadding="0" border="0" style="width: 700px;">\r\n<tbody>\r\n<tr>\r\n<td align="center"><font face="Arial" style="font-size: 8px;" size="2" color="#000000">&nbsp;Si ce message ne s''affiche pas correctement, vous pouvez le visualiser gr&acirc;ce &agrave; ce <a style="color: #3c779b;" href="#VIEW_ONLINE#"><font color="#3c779b">lien</font></a> </font></td>\r\n</tr>\r\n<tr>\r\n<td style="height: 200px;">\r\n<p>Madame, Monsieur,</p>\r\n<p></p>\r\n<p>Nous vous informons par la pr&eacute;sente que NUTRITIS sera pr&eacute;sent au salon FI Europe &amp; NI 2011 qui se tiendra au Parc des Expositions de PARIS Nord Villepinte du Mardi 29 Novembre au Jeudi 1<sup>er</sup> D&eacute;cembre.</p>\r\n<p>A cette occasion, notre &eacute;quipe commerciale a le plaisir de vous adresser une invitation gratuite pour pouvoir participer &agrave; cet &eacute;v&egrave;nement majeur et&nbsp; incontournable des Ingr&eacute;dients Alimentaires qui a lieu tous les 2 ans en alternance entre les 3 villes de Paris, Londres et Francfort.</p>\r\n<p>Pour faire valoir votre invitation gratuite vous devez vous rendre sur le site suivant <a href="http://nutritis.catalyz-emailing.com/campaign/link/key/#EMAIL#-9-1">www.fieregister.com</a> et proc&eacute;der &agrave; votre inscription en ligne.</p>\r\n<p>Notre num&eacute;ro de stand est le <b>1D75</b> (au fond du Hall 1) et nous serons ravis de vous y accueillir pour vous faire d&eacute;guster des &eacute;chantillons de produits finis &eacute;labor&eacute;s avec nos solutions sucrantes naturelles 100% extraites de fruits. Par ailleurs nous vous informons que nous mettrons en avant dans la zone &laquo;&nbsp;Produits Nouveaux et Innovants&nbsp;&raquo; notre produit r&eacute;f&eacute;renc&eacute; &laquo;&nbsp;FructiLight&reg;&nbsp;&raquo; qui pr&eacute;sente en plus d&rsquo;une saveur sucr&eacute;e jusqu&rsquo;&agrave; 70%&nbsp; sup&eacute;rieure &agrave; celle du sucre, un Index Glyc&eacute;mique (IG) de 11 soit l&rsquo;IG le plus bas de tous les sucres caloriques du march&eacute;.</p>\r\n<p>Dans l&rsquo;attente de votre visite sur notre stand, veuillez recevoir nos tr&egrave;s sinc&egrave;res salutations,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;L''&eacute;quipe Nutritis</p>\r\n<p>&nbsp;<img src="http://nutritis.catalyz-emailing.com/uploads/assets/invitation_FIE1.jpg" width="700" height="700" style="border-style: initial; border-color: initial; font-family: Arial; font-size: 8px; text-align: -webkit-center;" /><img src="http://nutritis.catalyz-emailing.com/uploads/assets/invitation_FIE2.jpg" width="700" height="700" /></p>\r\n<p></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align="center"><font face="Arial" style="font-size: 8px;" size="2" color="#000000"> Cliquez ici pour vous <a style="color: #000000;" href="#UNSUBSCRIBE#"> d&eacute;sabonner . </a></font></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</body>\r\n</html>', 6, 'Adriana GEORGES', 'a.georges@nutritis.com', NULL, 1, 2, 'adrianageorges@yahoo.fr;\r\nadriana.georges@gmail.com', '', NULL, NULL, 'pop3.nutritis.com', 'a.georges@nutritis.com', '0gnkn8', 0, 0, NULL, NULL, 0, NULL, NULL, NULL, '2011-11-21 14:57:11', 1, '2011-11-22 16:18:03'),
(8, 'Invitation FIE 2011 GB', NULL, 'Your free invitation to FI (Food Ingredients) Europe & NI (Natural Ingredients) 2011 in PARIS', 3, '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n	<title>#SUBJECT#</title>\r\n	<meta name="title" content="#SUBJECT#" />\r\n  <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n  <meta http-equiv="Content-Language" content="fr" />\r\n</head>\r\n	<body link="#222221;" marginheight="0" marginwidth="0" leftmargin="0" topmargin="0" bgcolor="#FFFFFF">\r\n<table bgcolor="#f8f7ee" align="center" cellspacing="0" cellpadding="0" border="0" style="width: 700px;">\r\n<tbody>\r\n<tr>\r\n<td align="center"><font face="Arial" style="font-size: 8px;" size="2" color="#000000">&nbsp;Si ce message ne s''affiche pas correctement, vous pouvez le visualiser gr&acirc;ce &agrave; ce <a style="color: #3c779b;" href="#VIEW_ONLINE#"><font color="#3c779b">lien</font></a> </font></td>\r\n</tr>\r\n<tr>\r\n<td style="height: 200px;">\r\n<p>Dear Madam, dear Sir,</p>\r\n<p>&nbsp;</p>\r\n<p>Hereby we&rsquo;d like to inform you that NUTRITIS will be exhibiting at the forthcoming FI Europe &amp; NI 2011 which will be held at Parc des Expositions de PARIS Nord Villepinte from Nov 29<sup>th</sup> till December 1<sup>st</sup>.</p>\r\n<p>&nbsp;</p>\r\n<p>For that occasion, our Sales Team is pleased to offer yo a free invitation to that major and incontrovertible Food Ingredients event taking place every 2 years alternatively with the 3 cities of Paris, Frankfurt and London.</p>\r\n<p>&nbsp;</p>\r\n<p>In order to get your free entrance active and validated, please go and click on the following link <a href="http://www.fieregister.com">www.fieregister.com</a> and proceed to your online registration.</p>\r\n<p>&nbsp;</p>\r\n<p>NUTRITIS&rsquo;s stand number is <b>1D75</b> (in the very back of HALL 1) and we&rsquo;ll be delighted to welcome and invite you for a tasting session of finished food products elaborated with our Natural &amp; 100% from Fruits sweetening solutions. More, we&rsquo;d like to inform you that we&rsquo;ll be exhibiting in the &ldquo;New &amp; Innovative Products Zone&rdquo; our <b>&laquo;&nbsp;FructiLight&reg;&nbsp;&raquo;</b> product which combines in addition to a high sweetness intensity up to +70% beyond the one of the sucrose, a Glycemic Index (GI) of 11 that is to say the lowest GI of all the nutritive sugars on the market.</p>\r\n<p>&nbsp;</p>\r\n<p>Looking forward to meeting you on our booth,</p>\r\n<p>&nbsp;</p>\r\n<p>Yours sincerely</p>\r\n<p>&nbsp;</p>\r\n<p>The NUTRITIS Team</p>\r\n<p>&nbsp;<img src="http://nutritis.catalyz-emailing.com/uploads/assets/invitation_FIE1.jpg" width="700" height="700" style="border-style: initial; border-color: initial; font-family: Arial; font-size: 8px; text-align: -webkit-center;" /><img src="http://nutritis.catalyz-emailing.com/uploads/assets/invitation_FIE2.jpg" width="700" height="700" /></p>\r\n<p></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align="center"><font face="Arial" style="font-size: 8px;" size="2" color="#000000"> Cliquez ici pour vous <a style="color: #000000;" href="#UNSUBSCRIBE#"> d&eacute;sabonner . </a></font></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</body>\r\n</html>', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n	<title>#SUBJECT#</title>\r\n	<meta name="title" content="#SUBJECT#" />\r\n  <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n  <meta http-equiv="Content-Language" content="fr" />\r\n</head>\r\n	<body link="#222221;" marginheight="0" marginwidth="0" leftmargin="0" topmargin="0" bgcolor="#FFFFFF">\r\n<table bgcolor="#f8f7ee" align="center" cellspacing="0" cellpadding="0" border="0" style="width: 700px;">\r\n<tbody>\r\n<tr>\r\n<td align="center"><font face="Arial" style="font-size: 8px;" size="2" color="#000000">&nbsp;Si ce message ne s''affiche pas correctement, vous pouvez le visualiser gr&acirc;ce &agrave; ce <a style="color: #3c779b;" href="#VIEW_ONLINE#"><font color="#3c779b">lien</font></a> </font></td>\r\n</tr>\r\n<tr>\r\n<td style="height: 200px;">\r\n<p>Dear Madam, dear Sir,</p>\r\n<p>&nbsp;</p>\r\n<p>Hereby we&rsquo;d like to inform you that NUTRITIS will be exhibiting at the forthcoming FI Europe &amp; NI 2011 which will be held at Parc des Expositions de PARIS Nord Villepinte from Nov 29<sup>th</sup> till December 1<sup>st</sup>.</p>\r\n<p>&nbsp;</p>\r\n<p>For that occasion, our Sales Team is pleased to offer yo a free invitation to that major and incontrovertible Food Ingredients event taking place every 2 years alternatively with the 3 cities of Paris, Frankfurt and London.</p>\r\n<p>&nbsp;</p>\r\n<p>In order to get your free entrance active and validated, please go and click on the following link <a href="http://nutritis.catalyz-emailing.com/campaign/link/key/#EMAIL#-10-1">www.fieregister.com</a> and proceed to your online registration.</p>\r\n<p>&nbsp;</p>\r\n<p>NUTRITIS&rsquo;s stand number is <b>1D75</b> (in the very back of HALL 1) and we&rsquo;ll be delighted to welcome and invite you for a tasting session of finished food products elaborated with our Natural &amp; 100% from Fruits sweetening solutions. More, we&rsquo;d like to inform you that we&rsquo;ll be exhibiting in the &ldquo;New &amp; Innovative Products Zone&rdquo; our <b>&laquo;&nbsp;FructiLight&reg;&nbsp;&raquo;</b> product which combines in addition to a high sweetness intensity up to +70% beyond the one of the sucrose, a Glycemic Index (GI) of 11 that is to say the lowest GI of all the nutritive sugars on the market.</p>\r\n<p>&nbsp;</p>\r\n<p>Looking forward to meeting you on our booth,</p>\r\n<p>&nbsp;</p>\r\n<p>Yours sincerely</p>\r\n<p>&nbsp;</p>\r\n<p>The NUTRITIS Team</p>\r\n<p>&nbsp;<img src="http://nutritis.catalyz-emailing.com/uploads/assets/invitation_FIE1.jpg" width="700" height="700" style="border-style: initial; border-color: initial; font-family: Arial; font-size: 8px; text-align: -webkit-center;" /><img src="http://nutritis.catalyz-emailing.com/uploads/assets/invitation_FIE2.jpg" width="700" height="700" /></p>\r\n<p></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align="center"><font face="Arial" style="font-size: 8px;" size="2" color="#000000"> Cliquez ici pour vous <a style="color: #000000;" href="#UNSUBSCRIBE#"> d&eacute;sabonner . </a></font></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</body>\r\n</html>', 6, 'Adriana GEORGES', 'a.georges@nutritis.com', NULL, 1, 2, 'adrianageorges@yahoo.fr;\r\nadriana.georges@gmail.com', '', NULL, NULL, 'pop3.nutritis.com', 'a.georges@nutritis.com', '0gnkn8', 0, 0, NULL, NULL, 0, NULL, NULL, NULL, '2011-11-22 11:10:14', 1, '2011-11-22 16:21:45'),
